  const originalAddClassFn = $.fn.addClass
  $.fn.addClass = function () {
    originalAddClassFn.apply(this, arguments)
    this.trigger(`addClassExec`)
    return this
  }

  /**
   * FUNCTIONS
   */

  const soundHuntersHornFn = () => {
    if (!soundHuntersHornFn.called && $('#envHeaderImg').is('.hornReady') && !stringIsTrue(getLocal('bot-status'))) {
      soundHuntersHornFn.called = true
      const randomTime = (Math.floor(Math.random() * 11) + 5) * 1000
      logger(`Sounding horn in ${randomTime}`)
      setTimeout(() => $('.mousehuntHud-huntersHorn-container a').simulate('click'), randomTime)
      setTimeout(() => soundHuntersHornFn.called = false, randomTime + 30000)
    }
  }

  const claimBoulderRewardFn = () => {
    if (!claimBoulderRewardFn.called && $('.mountainHUD-boulderContainer').is('.can_claim')) {
      claimBoulderRewardFn.called = true
      const randomTime = (Math.floor(Math.random() * 3) + 2) * 1000
      logger(`Claiming mountain boulder reward in ${randomTime}.`)
      setTimeout(() => $('.mountainHUD-boulder a').simulate('click'), randomTime)
      setTimeout(() => claimBoulderRewardFn.called = false, randomTime + 30000)
    }
  }

  const claimHalloweenRewardFn = () => {
    if (!claimHalloweenRewardFn.called && $('.halloweenHUD-campBanner').is('.hasReward')) {
      claimHalloweenRewardFn.called = true
      const randomTime = (Math.floor(Math.random() * 3) + 2) * 1000
      logger(`Claiming halloween reward in ${randomTime}.`)
      setTimeout(() => $('.halloweenHUD-campBanner-claimReward').simulate('click'), randomTime)
      setTimeout(() => claimHalloweenRewardFn.called = false, randomTime + 30000)

      let checkHalloweenRewardPopUp
      if (!checkHalloweenRewardPopUp) {
        checkHalloweenRewardPopUp = setInterval(() => {
          logger('Waiting for the halloween reward popup to appear.')
          if ($( $('#overlayPopup.multipleItems')).is(':visible')) {
            clearInterval(checkHalloweenRewardPopUp)
            $($('#jsDialogClose')).simulate('click')
            logger('Reward popup closed')
          }
        }, 500)
      }
    }
  }

  const autoRearmCannonFn = () => {
    const noActiveCannon = $('.halloweenHUD-campBanner-cannonBall-button').get().every(el => !$(el).is('.selected'))
    const autoRearmEnabled = stringIsTrue(getLocal('auto-rearm'))
    const cannonBtns = $('.halloweenHUD-campBanner-cannonBall-button').get().reverse()
    const cannonToActivate = cannonBtns.find(el => !$(el).is('.empty, .disabled, .selected'))
    console.log({ noActiveCannon, autoRearmEnabled, cannonToActivate })
    if (!!cannonToActivate && !autoRearmCannonFn.called && autoRearmEnabled && noActiveCannon) {
      autoRearmCannonFn.called = true
      const randomTime = (Math.floor(Math.random() * 2) + 1) * 1000
      logger(`Activating halloween cannon in ${randomTime}.`)
      setTimeout(() => $(cannonToActivate).simulate('click'), randomTime)
      setTimeout(() => autoRearmCannonFn.called = false, randomTime + 30000)
    }
  }

  const findMouse = mouseName =>
    mouseName.length > 0 ? mouseSearchData
      .filter(data => data.Mouse.toLowerCase() === mouseName.toLowerCase())
      .sort((a, b) => {
        const key = 'Attraction Rate'
        return parseFloat(a[key], 10) > parseFloat(b[key], 10) ? -1 : 1
      }) :
      null

  const startHalloweenGame = () => {
    logger('Creating new halloween game data.')
    setLocal('halloween-game', JSON.stringify(Array(18).fill('--')))
  }

  const halloweenGameSaveResultToIndex = ({ index, result }) => {
    const gameState = JSON.parse(getLocal('halloween-game'))
    if (parseInt(index) >= 0) {
      logger(`Saving index ${index} with value ${result}.`)
      gameState[index] = result
      setLocal('halloween-game', JSON.stringify(gameState))
    }
  }

  const renderHalloweenGameState = () => {
    const gameState = JSON.parse(getLocal('halloween-game'))
    $('.halloweenMemoryGame-card-container').each(function (index) {
      $(this).find('.remove-me').remove()
      $(this).find('.halloweenMemoryGame-card-margin').prepend(`<div class="remove-me">${gameState[index]}</div>`)
    })
  }

  // Extend ajax response handler
  hookAjax({
    onreadystatechange : ({ xhr }) => {
      const halloweenURL = 'https://www.mousehuntgame.com/managers/ajax/events/halloween_trickortreat.php'
      const halloweenPopUpElement = $('#overlayPopup.halloweenMemoryGame')
      if (xhr.readyState === 4 && xhr.responseURL === halloweenURL) {
        let checkGameBoardPopUp
        if (!checkGameBoardPopUp) {
          checkGameBoardPopUp = setInterval(() => {
            if ($(halloweenPopUpElement).is(':visible')) {
              logger('Halloween Game Loaded.')
              clearInterval(checkGameBoardPopUp)
              renderHalloweenGameState()
            }
          }, 1000)
        }
      }
    }
  })


  /**
   * Event listeners on elements
   */
  window.handleAutoRearmChangeMH = el => {
    setLocal('auto-rearm', $(el).prop('checked'))
    claimHalloweenRewardFn()
  }
  window.handleShowDebugChangeMH = el => setLocal('bot-debug', $(el).prop('checked'))
  window.handleDisableBotMH = el => setLocal('bot-status', $(el).prop('checked'))
  window.handleMouseSearchMH = ev => {
    if (ev.which === 13) {
      const mouseName = $('#search-mouse').val()
      const searchResult = findMouse(mouseName)

      const win = window.open("", "", "width=1000,height=500")
      $(win.document.body).html(`
        <table>
          ${searchResult.map(r =>
            `<tr>
              <td>Location: ${r.Location}</td>
              <td>Phase: ${r.Phase}</td>
              <td>Cheese: ${r.Cheese}</td>
              <td>Charm: ${r.Charm}</td>
              <td>AR: ${r['Attraction Rate']}</td>
            </tr>`
          ).join().replace(',', '')}
        </table>
      `)
    }
  }

  const originalNewNormalHalloweenGame = window.app.views.HeadsUpDisplayView.hud.halloweenMemoryGameStartNew
  window.app.views.HeadsUpDisplayView.hud.halloweenMemoryGameStartNew = () => {
    originalNewNormalHalloweenGame()
    startHalloweenGame()
  }

  const originalNewUpgradedHalloweenGame = window.app.views.HeadsUpDisplayView.hud.halloweenMemoryGameStartNewPlus
  window.app.views.HeadsUpDisplayView.hud.halloweenMemoryGameStartNewPlus = () => {
    originalNewUpgradedHalloweenGame()
    startHalloweenGame()
  }

  const originalHalloweenFn = window.app.views.HeadsUpDisplayView.hud.halloweenMemoryGameSelectCard
  window.app.views.HeadsUpDisplayView.hud.halloweenMemoryGameSelectCard = el => {
    originalHalloweenFn(el)
    let result
    const containerEl = $(el).parent().parent()
    const index = $(el).data('cardId')
    let containerLoadState
    if (!containerLoadState) {
      containerLoadState = setInterval(() => {
        if(!$(containerEl).is('.loading')) {
          clearInterval(containerLoadState)
          result = $(containerEl).find('.halloweenMemoryGame-card-reward-name').text().substring(0, 12)
          halloweenGameSaveResultToIndex({ index, result })
        }
      }, 500)
    }
  }


  /**
   * Components
   */
